import { StyleSheet } from "react-native"

const appStyle = StyleSheet.create({
    layout: {
        backgroundColor: "#282a37",
        flexDirection: "row",
        alignItems: "center",
        borderColor: "#fff",
        borderBottomWidth: 1,
        marginBottom: 20
    }
});

export default appStyle
